import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";
//import userlist from ./userlist

const UserDetails = (username) => {

    return <button>clicked {username}</button>;
    //return <button>not clicked</button>;
}

const Userlist = () => {

    const [Users, setUsers] = useState([]);

    React.useEffect(() => {
    //axios.get("http://localhost.5000/userlist").then((response) => {
    axios.get("http://127.0.0.1:5000/userlist").then((response) => {
        console.log(response.data);
        setUsers(response.data);
    });
    });

    return(
        <div>
        <ul>
            {Users.map(item=> {
                return(
                    <li key={item.id}>
                    <ul>
                        <li>
                            <UserDetails username={item.username}/>
                        </li>
                    </ul>
                    </li>
                );
            })}
        </ul>
        </div>
    );
};

